import React from 'react';
import { Card } from 'react-bootstrap';
import '../courses/courses.styles.css';

import java from '../courses/asset/java_1.png';
import selenium from '../courses/asset/selenium.png';
import appium from '../courses/asset/Appium.png';
import cucumber from '../courses/asset/cucumber.png';
import manual from '../courses/asset/manual.png';
import oracle from '../courses/asset/oracle.png';
import webservices from '../courses/asset/cucumber.png';

class Course extends React.Component{
    constructor(){
        super()
        this.state = {
            images:[{id:0,name:java,title:Java},
                {id:1,name:selenium,title:Selenium},
                {id:2,name:appium,titile:Appuim},
                {id:3,name:manual,title:Manual},
                {id:4,name:oracle,title:Oracle},
                {id:5,name:python,title:Python},
                {id:6,name:webservice,title:WebService},
                {id:7,name:cucumber,title:Cucumber}]
        }
    }

    render(){
        return(
            <div className="container">
                <h1>Course</h1>
                <Card style={{ width: '18rem' }}>
                    <Card.Img variant="top" src={javaimg}/>
                    <Card.Body>
                        <span className="title">Java</span>
                    </Card.Body>
                </Card>
            </div>
        )
    }
}
export default Course;
